import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract Game is Ownable {
    using SafeERC20 for IERC20;
    using SafeMath for uint256;

    IERC20 public token;

    uint256 private constant DAYS = 1 days;
    uint256 private constant TIMEDEFAULT = 1647216000;

    address private constant addressZero = address(0x00000000000);
    address public treasuryAdmin;
    uint256 priceOfLifes = 50000000;
    uint256 priceOfSkills = 10000000;
    uint256 private MAXLIFE = 5;

    mapping(uint256 => uint256) Level; // Point in Level
    mapping(uint256 => Skills) idSkills;
    mapping(address => mapping(uint256 => uint256)) addressToBuyTimes;

    Skills[] public SkillGame;

    struct Skills {
        string name;
        uint256 price;
        uint256 idSkill;
    }

    event playerBuySlots(uint256 indexed slots, address token);
    event playerBuySkills(
        uint256 indexed idSkill,
        address indexed token,
        uint256 level
    );
    event setAddressTokenCustomEvent(address indexed token);
    event createSkillsEvent(
        uint256 indexed idSkill,
        string indexed name,
        uint256 price
    );
    event changePointLevel(uint256 indexed level, uint256 amount);

    constructor(address _treasuryAdmin, address _token) {
        token = IERC20(_token);
        treasuryAdmin = _treasuryAdmin;
    }

    modifier checkTime() {
        uint256 daysTime;
        daysTime = block.timestamp.sub(TIMEDEFAULT).div(DAYS);
        require(
            addressToBuyTimes[msg.sender][daysTime] <= MAXLIFE,
            "exceed the specified number of times"
        );
        _;
    }

    function checkBalance() external view returns (uint256) {
        return token.balanceOf(msg.sender);
    }

    function checkTimeBuyInDays(uint256 _days) public view returns (uint256) {
        return addressToBuyTimes[msg.sender][_days];
    }

    function setAddressTokenCustom(address _token) external onlyOwner {
        token = IERC20(_token);
        emit setAddressTokenCustomEvent(_token);
    }

    function createSkills(
        uint256 _idSkill,
        string memory _name,
        uint256 _price
    ) external onlyOwner {
        Skills memory _skill = Skills({
            name: _name,
            price: _price,
            idSkill: _idSkill
        });
        SkillGame.push(_skill);
        idSkills[_idSkill] = _skill;
        emit createSkillsEvent(_idSkill, _name, _price);
    }

    function setPointLevel(uint256 _level, uint256 _point)
        external
        onlyOwner
        returns (bool)
    {
        Level[_level] = _point;
        emit changePointLevel(_level, _point);
        return true;
    }

    //Buy slot using native Token
    function buyLifesNative(uint256 _amountSlots)
        external
        payable
        checkTime
        returns (bool)
    {
        uint256 daysTime;
        daysTime = block.timestamp.sub(TIMEDEFAULT).div(DAYS);
        require(
            msg.value >= _amountSlots.mul(priceOfLifes),
            "peoply not fund to buy"
        );

        payable(treasuryAdmin).transfer(_amountSlots.mul(priceOfLifes));
        addressToBuyTimes[msg.sender][daysTime] += _amountSlots;

        emit playerBuySlots(_amountSlots, addressZero);
        return true;
    }

    //Buy slots using Token ERC20,BEP20
    function buyLifes(uint256 _amountSlots) external checkTime returns (bool) {
        uint256 daysTime;
        daysTime = block.timestamp.sub(TIMEDEFAULT).div(DAYS);

        require(
            token.balanceOf(msg.sender) >= _amountSlots.mul(priceOfLifes),
            "peoply not fund to buy"
        );
        token.safeTransferFrom(
            msg.sender,
            treasuryAdmin,
            _amountSlots.mul(priceOfLifes)
        );

        addressToBuyTimes[msg.sender][daysTime] += _amountSlots;

        emit playerBuySlots(_amountSlots, address(token));
        return true;
    }

    //Buy skills by Native Token
    function buySkillsNative(uint256 _idSkill, uint256 _level)
        external
        payable
        returns (Skills memory skills)
    {
        require(
            msg.value >= idSkills[_idSkill].price,
            "peoply not fund to buy"
        );
        payable(treasuryAdmin).transfer(idSkills[_idSkill].price);

        emit playerBuySkills(_idSkill, addressZero, _level);
        return idSkills[_idSkill];
    }

    //Buy skills by Token custom

    function buySkills(uint256 _idSkill, uint256 _level)
        external
        returns (bool)
    {
        // IERC20 tokenSkill = _token;

        require(
            token.balanceOf(msg.sender) >= idSkills[_idSkill].price,
            "peoply not fund to buy"
        );

        token.safeTransferFrom(
            msg.sender,
            treasuryAdmin,
            idSkills[_idSkill].price
        );

        emit playerBuySkills(_idSkill, address(token), _level);
        return true;
    }
}
